import '../App.css';
import React from 'react'
import {Link} from 'react-router-dom';

const NavBar = (props) =>{

  return(
    <li className="navBar">
      <Link to = "/">Home</Link> 
      <Link to = "/Username">Profile</Link>  
      <div>{props.user}</div>
    </li>

  )
}

export default NavBar;
